use std::io;
use std::path::Path;
use std::process::Command;

pub async fn play_audio(url: String) -> Result<(), Box<dyn std::error::Error>> {
    // Download the audio file
    let mut response = reqwest::get(url).await?;
    let mut file = tokio::fs::File::create("audio.mp3").await?;
    io::copy(&mut response, &mut file).await?;

    // Play the audio file using a system-specific command
    let command = match std::env::consts::OS {
        "linux" => "mpg321",
        "macos" => "afplay",
        "windows" => "start",
        _ => panic!("Unsupported OS"),
    };
    let args = match std::env::consts::OS {
        "linux" => vec!["audio.mp3"],
        "macos" => vec!["audio.mp3"],
        "windows" => vec!["audio.mp3"],
        _ => panic!("Unsupported OS"),
    };
    let status = Command::new(command).args(args).status().await?;
    if !status.success() {
        eprintln!("Error playing audio: {}", status);
    }

    Ok(())
}
```

