You can change the background color of an Adaptive Card by adding a `background` property to the `style` object of the card's container. Here is an example:
```json
{
  "type": "AdaptiveCard",
  "version": "1.0",
  "body": [
    {
      "type": "Container",
      "style": {
        "background": "#FF0000" // red background color
      },
      "items": [
        {
          "type": "TextBlock",
          "text": "Hello World!"
        }
      ]
    }
  ]
}
```
In this example, the `background` property is set to `#FF0000`, which is the hex code for red. You can replace this with any valid hex code or color name to change the background color.

Alternatively, you can also use the `background-color` property instead of `background`.

If you are using the Adaptive Card Designer, you can add a style to the card's container by clicking on the container element in the designer, and then clicking on the "Style" tab in the properties panel. From there, you can add a new style property and set the `background` or `background-color` property to the desired value.

Note that the background color will only be applied to the container element and its child elements. If you want to change the background color of the entire card, you can add the `background` property to the card's root element, like this:
```json
{
  "type": "AdaptiveCard",
  "version": "1.0",
  "style": {
    "background": "#FF0000" // red background color
  },
  "body": [
    {
      "type": "TextBlock",
